INSERT INTO `opinions` (`id`, `rate_value`, `opinion_text`, `product_id`, `user_id`) VALUES
(3, 5, 'Egyszerűen lenyűgöző! A QuantumPc-9000 olyan, mintha egy másik dimenzióból érkezett volna. A kvantummagok száma és az órajel olyan magas, hogy a jövőbeli játékok és munkafolyamatok is csak nevetve hajolnak meg előtte.', 17, 4),
(4, 4, 'A QuantumRAM QM-128 olyan hatalmas, hogy még a legnagyobb adatbázisok is csak csepp a tengerben. És a QuantumRender QR-9000? Nos, a képminőség olyan élethű, hogy néha azt hiszem, kiléptem a valóságból.', 16, 5),
(5, 5, 'Ami igazán lenyűgöző, az a holografikus interfész. A QuantumHUD QH-360 olyan, mintha egy másik világban lennék. A 360 fokos megjelenítés és a gyorsított gondolkodás lehetővé teszi, hogy a munkám és a játékaim között szinte észrevétlenül váltogassak.', 17, 4),
(6, 5, 'Az ára? Nos, a jövőben a pénz is kvantum, és a QuantumVision XG-9000 minden fillérjét megéri. Ha valaha is azt érezted, hogy a jelenlegi technológia nem elég, akkor ez a számítógép a te géped!', 17, 5),
(7, 2, 'Ez a számítógép egy totális csalódás. Az ára magasabb, mint egy űrutazás, és mégsem éri meg. A QuantumCore QX-42 processzor olyan, mintha egy lassú óra lenne, amelyet homokban hajtottak meg. A 42 kvantummag csak arra jó, hogy a felhasználók frusztráltan várakozzanak', 16, 3),
(8, 3, 'A QuantumRAM QM-128 olyan nehéz, hogy a számítógépem asztalát már alig bírja el. És a QuantumRender QR-9000? Nos, a képminőség olyan homályos, hogy néha azt hiszem, egy régi CRT monitor előtt ülök.\r\n\r\nDe ami igazán bosszantó, az a holografikus interfész. A QuantumHUD QH-360 olyan, mintha egy rosszul összerakott VR szemüveget viselnék. A 360 fokos megjelenítés inkább hányingert okoz, mintsem lenyűgöz.', 16, 3);

