(12, 'HyperVision XG-9000', 360999, 'HyperVision XG-9000\r\n\r\nKépátló: 34 hüvelyk\r\nFelbontás: UltraWide 1440p (3440 × 1440)\r\nPanel: Quantum Nano IPS\r\nVálaszidő: 0,5 ms\r\nKépfrissítési gyakoriság: 240 Hz\r\nKontrasztarány: 5000:1\r\nSzíbtartomány: 99% DCI-P3\r\nTámogatja a RayTracer Gaming Engine-t\r\nBeépített RGB világítás a hátlapon', 2, 13),
(13, 'HyperVision XG-7000', 120000, 'Képátló: 27 hüvelyk\r\nFelbontás: Full HD (1920 × 1080)\r\nPanel: IPS\r\nVálaszidő: 5 ms\r\nKépfrissítési gyakoriság: 75 Hz\r\nKontrasztarány: 1000:1\r\nSzíbtartomány: sRGB\r\nBeépített hangszórók', 2, 14),
(14, 'QuantumVision XG-9000', 345000, 'Gyártási technológia: 4 nm\r\nMagok száma: 8 mag, beleértve a Cortex-X2-t is, amely 3 GHz-es órajelen dolgozik.\r\nTovábbi magok: Három darab Cortex-A710 (2,5 GHz) és négy darab Cortex-A510 (1,79 GHz).\r\nGrafikus processzor: Adreno 730 GPU\r\nGyártó: Samsung gyártósora', 4, 15),
(15, 'MediaTek Dimensity 2000', 130000, 'Gyártási technológia: 4 nm\r\nMagok száma: Három darab Cortex-A710 (2,85 GHz), ami gyorsabb lehet a Snapdragon 898-nál.\r\nTovábbi magok: Négy darab Cortex-A510 (1,79 GHz).\r\nGrafikus processzor: Mali-G710 MC10\r\nGyártó: TSMC', 4, 15),
(16, 'QuantumPC-9000', 3700000, 'Processzor: QuantumCore QX-42\r\nMagok száma: 42 kvantummag\r\nÓrajel: 10 GHz (szuperszonikus sebesség)\r\nHűtés: Folyékony héliummal hűtött kvantumcsatornák\r\nMemória: QuantumRAM QM-128\r\nKapacitás: 128 TB\r\nSebesség: 1 Yottabyte/s (igen, Yottabyte!)\r\nGrafikus processzor: QuantumRender QR-9000\r\nKvantum pixelek: 9000x9000\r\nRay-tracing: Valós idejű kvantumoptika\r\nTároló: QuantumDrive QD-1PB\r\nKapacitás: 1 Petabyte\r\nSebesség: 10 Exabyte/s\r\nHolografikus interfész: QuantumHUD QH-360\r\n360 fokos megjelenítés: Virtuális valóságban\r\nGyorsított gondolkodás: Kvantumintelligencia segítségével', 5, 17),
(17, 'QuantumPc-10000', 3850000, 'Processzor: QuantumCore QX-42\r\nMagok száma: 42 kvantummag\r\nÓrajel: 10 GHz (szuperszonikus sebesség)\r\nHűtés: Folyékony héliummal hűtött kvantumcsatornák\r\nMemória: QuantumRAM QM-128\r\nKapacitás: 128 TB\r\nSebesség: 1 Yottabyte/s (igen, Yottabyte!)\r\nGrafikus processzor: QuantumRender QR-9000\r\nKvantum pixelek: 9000x9000\r\nRay-tracing: Valós idejű kvantumoptika\r\nTároló: QuantumDrive QD-1PB\r\nKapacitás: 1 Petabyte\r\nSebesség: 10 Exabyte/s\r\nHolografikus interfész: QuantumHUD QH-360\r\n360 fokos megjelenítés: Virtuális valóságban\r\nGyorsított gondolkodás: Kvantumintelligencia segítségével', 5, 18);

